import React from "react";
import styles from "./CardInfo.css";

export default function CardInfo({ header, text, link, extraClass }) {
  return (
    <div className={`${extraClass} ${styles.InlineBlock}`}>
      <h2 className={styles.CardInfoHeader}>{header}</h2>
      <p className={styles.CardInfoText}>
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
